const activo = true;

if (activo) {
  const nombre = "Juan";
  let apellidos = "Pérez";
  console.log(nombre, " ", apellidos);

  if (true) {
    nombre = "Pedro";
    apellidos = "García";
    console.log(nombre, " ", apellidos);
  } else {
    console.log(nombre, " ", apellidos);
  }
}
